path.aria-label:
server {
        # Escuta na porta 80 - HTTP
        listen       80;
        # Aplicado apenas para o(s) domínio(s) setados
        server_name ec2-3-88-144-184.compute-1.amazonaws.com;

        # Local da pasta onde está o código do site (produção)
        root         /usr/share/nginx/html;
        # Arquivo main
        index /site.html;

        location / {
            # Logs
            access_log /var/log/nginx/access.log;
            error_log /var/log/nginx/error.log;
        }

        location /index {
            # tenta carregar um arquivo específico para a rota /index
            try_files $uri $uri/ /index.html;
            # Logs
            access_log /var/log/nginx/access-teste.log;
            error_log /var/log/nginx/error-teste.log;
        }

        # Quando der erro 404, redireciona para location =  NotFound e carrega um html específico
        error_page 404 /NotFound;
        location /NotFound {
            try_files $uri $uri/ /errorpage/erro404.html;
        }
}

